The `prop` variable is presumably the proportion of babies with that `name` and `sex` in a given year:


::: {.cell}

```{.r .cell-code}
babynames %>%
  group_by(sex, year) %>%
  mutate(n_total = sum(n)) %>%
  ungroup() %>%
  mutate(prop_manual = n / n_total) %>%
  select(prop, prop_manual)
```

